import React from "react";

const Footer = () => {
    return (
        <>
            <div className="text-center text-secondary">
                <h4>made with ❤️ by Sohan</h4>
                <h5>IT, Jadavpur University</h5>
            </div>
        </>
    );
};

export default Footer;
